// import { jsPDF } from "jspdf"
const { jsPDF } = window.jspdf;
var font =
  "";
var callAddFont = function () {
  this.addFileToVFS("centurygothic_bold-bold.ttf", font);
  this.addFont("centurygothic_bold-bold.ttf", "centurygothic_bold", "bold");
};
jsPDF.API.events.push(["addFonts", callAddFont]);
